import './En.css';
import will from './assets/will.jpg';
import cf from './assets/cf.png'
import discord from './assets/discord.png'
import git from './assets/git.png'
import instagram from './assets/instagram.png'
import telegram from './assets/telegram.png'
import horn from './assets/mlg.mp3';
import { useState, useRef } from 'react';
import Zoom from 'react-reveal/Zoom'; 
import Fade from 'react-reveal/Fade';
import Bounce from 'react-reveal/Bounce';
import Reveal from 'react-reveal/Reveal';

function Home() {
    const [crosshairs, setCrosshairs] = useState([]);
    const isPlaying = useRef(false); // Ref para controlar se o som está tocando

    const handleImageClick = () => {
      if (isPlaying.current) return; // Não faz nada se o som já estiver tocando
  
      const newCrosshairs = Array.from({ length: 10 }, () => {
        const size = 50; // Tamanho da crosshair
        const x = Math.random() * (window.innerWidth - size); // Posição horizontal
        const y = Math.random() * (window.innerHeight - size); // Posição vertical
        return {
          top: `${y}px`,
          left: `${x}px`,
          opacity: 1,
        };
      });
      setCrosshairs(newCrosshairs);
  
      // Reproduz o som de buzina
      const audio = new Audio(horn);
      audio.play();
      isPlaying.current = true; // Marca que o som está tocando
  
      // Remove as crosshairs após 1 segundo
      setTimeout(() => {
        setCrosshairs([]);
      }, 1000);
  
      // Para o som após 15 segundos
      setTimeout(() => {
        isPlaying.current = false; // Marca que o som parou
      }, 7500);
    };
    const handleDragStart = (e) => {
        e.preventDefault(); // Previne o arrasto da imagem
      };
  return (
    <main className="content">
    <div className="title-container"> {/* Adicionando o contêiner aqui */}
        <div className="title">
        <Fade delay={201}>
            <label className="name">Gustavo "Dark" Lass</label>
            <div className="divider"></div>
            <label className="undertext">Full-Stack Developer - Bachelor in Computer Science by UDESC. <br></br> 17 years, 7 anos+ de experiência em desenvolvimento</label>
        </Fade>
        <Fade delay={501}>
            <ul className="buttons"> 
                <li>
                    <a target="_blank" href="https://github.com/D4rkks"><img title="Github" className="img" src={git} /></a>
                </li>
                <li>
                    <a target="_blank" href="https://codeforces.com/profile/D4rkks"><img title="Codeforces" className="img" src={cf} /></a>
                </li>
                <li>
                    <a target="_blank" href="https://discord.com/users/247726496435666944/"><img title="Discord" className="img" src={discord} /></a>
                </li>
                <li>
                    <a target="_blank" href="https://www.instagram.com/gustavo.lass/"><img title="Instagram" className="img" src={instagram} /></a>
                </li>
                <li>
                    <a href=""><img title="Telegram" className="img" src={telegram} /></a>
                </li>
            </ul>
            </Fade>
        </div>
        <Bounce>
        <div className="will-smith" onClick={handleImageClick}>
            <img 
                src={will} 
                alt="Im Jobless" 
                className="will-smith" 
                onDragStart={handleDragStart} // Previne o arrasto
            />
        </div>
        </Bounce>
    </div>

    {crosshairs.map((style, index) => (
        <div key={index} className="crosshair" style={style}></div>
    ))}
    <Fade delay={1001}>
    <div className="skills">
        <label className="title">Skills</label>
    </div>
    </Fade>
    </main>

  );
}

export default Home;
